import './App.css';
import * as d3 from "d3";

function App() {



  async function mainFunc(){
    const layout = d3.xml("./images/layout.svg");
    layout.then(function(data){
      console.log(layout);
      d3.select('#container').html(data);
    })

    console.log('hello');
    const data = await d3.csv("./images/layout.svg");
    console.log(data);
  }

  mainFunc();

  return (
    <div id="container" className="App">
      hello
    </div>
  );
}

export default App;
